import React from 'react';
import ConcertCard from "./ConcertCard"

function TourSchedule() {
  const concertsUrl = 'http://localhost:6001/concerts';

  function fetchConcerts() {
    fetch(concertsUrl)
      .then(r => r.json())
      .then(console.log)
  }
  return (
    <>
      <ConcertCard />
    </>
  );
}

export default TourSchedule;
